import { Navbar, Nav, NavItem, NavLink } from "reactstrap";

const Header = () => {
  return (
    <>
      <Navbar>
        <Nav>
          <NavItem>
            <NavLink href="/home">Home</NavLink>
          </NavItem>

          <NavItem>
            <NavLink href="/profile">Profile</NavLink>
          </NavItem>

          <NavItem>
            <NavLink href="/logout">Logout</NavLink>
          </NavItem>
        </Nav>
      </Navbar>
    </>
  );
};

export default Header;
